type propModal = {
    open: boolean
}


export default function ModalProject(open: propModal){

    return (<>
        {open.open && (
        <div className="w-full h-screen bg-white/5 backdrop-blur-xl absolute flex justify-center items-center z">
            <div className="w-modal rounded-xl h-96  bg-white z-20 top-52 left-1" > </div>
        </div>


        )}
    </>

    )
}
